import React from "react";
import { Card, Typography } from "@mui/material";

export const Docinfo = () => {
  return (
    <div>
      <Card
        elevation=""
        sx={{ my: { xs: 4, md: 4 }, p: { xs: 2, md: 4 } }}
        className="Card"
      >
        <Typography>Your Booked Appointments</Typography>
      </Card>
    </div>
  );
};
